        console.log("Call to wasm_bindgen.isobands took " + (t1 - t0) + " milliseconds for case " +  i + " / " + name + " (" + data.length + " data points).");

        const features = res.features;

        const width = name.indexOf('Minimal') > -1 ? (windowWidthDivided - 10) / 3 - 10 : windowWidthDivided - 15;
        const height = 430;
        const strokeWidth = name === 'Volcano x16' ? 0 : 0.5;
        const fillOpacity = 0.55;
        const marginBottomLabel = 25;

        const projection = d3
            .geoIdentity()
            //.reflectY(true)
            .fitExtent(
                [
                    [10, 10],
                    [width - 10, height - 10]
                ],
                {
                    type: 'FeatureCollection',
                    features: features,
                }
            );
        const path = d3.geoPath(projection);
        
        const color = d3.scaleSequential(d3.interpolateSinebow)
            .domain([intervals[0], intervals[intervals.length - 1] + 1]);

        if (seen === false && name.indexOf("Minimal") > -1) {
          seen = true;
          d3.select('.container').append('br');
        }
        const svg = d3.select('.container')
            .append("svg")
            .attr("width", width)
            .attr("height", height + marginBottomLabel)
            .style('border', '1px solid black');

        svg.append('text')
            .attr('x', width / 2)
            .attr('y', height + marginBottomLabel - 10)
            .style('text-anchor', 'middle')
            .text(`${name} (${w * h} points)`);
            //.text(name.indexOf('Minimal') < 0 ? `${name} (${w * h} points) - ${(t1 - t0)}ms` : `${name} (${w * h} points)`);

        svg.selectAll("path")
            .data(features)
            .enter()
            .append("path")
            .style("fill", (d) => color(d.properties.min_v))
            .style('fill-opacity', fillOpacity)
            .style("stroke", "black")
            .style('stroke-width', strokeWidth)
            .attr("d", (d) => path(d))
            .on('mouseover', function () {
                d3.select(this).style('fill', 'red');
            })
            .on('mouseout', function () {
                d3.select(this).style('fill', (d) => color(d.properties.min_v))
            });

    })

</script>
</body>
</html>
